const handleSignUp = async () => {
  if (password !== confirmPassword) {
    alert('Passwords do not match');
    return;
  }

  try {
    const formattedDateOfBirth = dateOfBirth ? dateOfBirth.toISOString().split('T')[0] : null;

    const userData = {
      userName,
      password,
      name: 'Your Name', // Replace with the user's name
      email,
      countryOfOrigin: selectedCountry,
      dateOfBirth: formattedDateOfBirth,
      isActive: true,
      experience: null,
      projectsCompleted: null,
      companyName: null,
      startTime: null,
      endTime: null,
      contractorSpecialization: null,
      userType: 'SELLER', // Replace with the desired user type
    };

    const response = await fetch('http://localhost:3000/user', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(userData),
    });

    const data = await response.json();

    if (response.ok) {
      alert('Signup successful');
      console.log(data);
    } else {
      alert(data.message);
    }
  } catch (error) {
    console.error('Error:', error);
    alert('Signup failed');
  }
};
